  const [pointX, setPointX] = useState(0);
  const [pointY, setPointY] = useState(0);
  const [startPos, setStartPos] = useState({ x: 0, y: 0 });
  const [touchStartTime, setTouchStartTime] = useState(0);

  const panningConstraints = {
    pointXMax: 720,
    pointXMin: -720,
    pointYMax: 400,
    pointYMin: -400,
  };

  const handleZoomOutClick = () => {
    if (zoom > zoomMinValue) {
      setZoom(zoom - zoomStep);
    }
  };

  const handleZoomInClick = () => {
    if (zoom < zoomMaxValue) {
      setZoom(zoom + zoomStep);
    }
  };

  const handleMouseDown = (e: React.MouseEvent) => {
    setStartPos({ x: e.clientX - pointX, y: e.clientY - pointY });
    setPanning(true);
  };

  const handleMouseUp = () => {
    setPanning(false);
  };

  const handleMouseMove = (e: React.MouseEvent) => {
    if (!panning) return;

    const newPointX = e.clientX - startPos.x;
    const newPointY = e.clientY - startPos.y;

    if (newPointX < panningConstraints.pointXMax && newPointX > panningConstraints.pointXMin) {
      setPointX(newPointX);
    }

    if (newPointY < panningConstraints.pointYMax && newPointY > panningConstraints.pointYMin) {
      setPointY(newPointY);
    }
  };

